                    "x": 360.0,
                    "y": 432.0,
                    "data": "TFFT\u975e\u5e38\u6709\u7528,\u53ea\u8981\u4f60\u4e0d\u60f3\u5f04\u4e00\u5806\u8d85\u7ea7\u7f38,\u540c\u65f6\u5b83\u8fd8\u6709\u6a21\u5757\u5316\u7ed3\u6784,\u53ef\u4ee5\u8fbe\u5230\u6bd4\u4efb\u52a1\u63cf\u8ff0\u59274.33\u500d\u7684\u5bb9\u91cf.</br></br>T1\u7684\u5b58\u50a8\u5e93\u65b9\u5757\u642d\u6210\u7684TFFT,\u6d88\u801727-EU/t,\u4f46\u6bcf\u79cd\u6d41\u4f53\u7684\u50a8\u91cf\u4ec5\u4e3a\u8d85\u7ea7\u7f38I\u76840.27\u500d.</br></br>\u800cT5\u7684\u5b58\u50a8\u5e93\u65b9\u5757\u642d\u6210\u7684TFFT,\u6d88\u80171134-EU/t\u800c\u6bcf\u79cd\u6d41\u4f53\u7684\u50a8\u91cf\u4e3a\u91cf\u5b50\u7f38III\u76840.54\u500d.</br></br>T10\u5b58\u50a8\u5e93\u65b9\u5757\u642d\u6210\u7684TFFT \u6d88\u8017 0EU/t (\u53ea\u6709T10\u6d88\u8017 0) \u4e14\u62e5\u6709T7 YOT\u50a8\u7f50\u7ea6 3.3 \u500d\u7684\u603b\u5bb9\u91cf (\u9664\u4ee5 25 \u4fbf\u662f\u6bcf\u79cd\u6d41\u4f53\u7684\u5bb9\u91cf)</br></br>\u901a\u8fc7\u8d34\u5728T.F.F.T\u8f93\u5165/\u8f93\u51fa\u4ed3\u4e0a\u7684ME\u6d41\u4f53\u5b58\u50a8\u603b\u7ebf\u6216\u662fEIO\u7684\u672b\u5f71\u6d41\u4f53\u5bfc\u7ba1,\u4f60\u53ef\u4ee5\u76f4\u63a5\u8bbf\u95ee\u6240\u6709\u6d41\u4f53.</br></br>[note]\u8bb0\u5f97\u6253\u5f00\u81ea\u52a8\u9500\u6bc1\u529f\u80fd\u5982\u679c\u9700\u8981\u7684\u8bdd.[/note]</br></br> WIKI T.F.F.T\uff1a\u00a79gtnh.huijiwiki.com/p/409\u00a7r",
                    "quest_id": "AAAAAAAAAAAAAAAAAAAKzQ==",
