                    "x": 300.0,
                    "y": 312.0,
                    "data": "\u865a\u7a7a\u91c7\u77ff\u573a\u51e0\u4e4e\u548c\u666e\u901a\u91c7\u77ff\u573a\u4e00\u6837,\u53ea\u4e0d\u8fc7\u5b83\u662f\u4ece\u6240\u5728\u7ef4\u5ea6\u7684\u6574\u4e2a\u77ff\u77f3\u6c60\u5185\u76f4\u63a5\u63d0\u53d6\u77ff\u77f3. \u6b64\u5916,\u4f60\u53ef\u4ee5\u901a\u8fc7\u63d0\u4f9b\u6c16\u3001\u6c2a\u3001\u6c19\u6216\u9feb\u6765\u63d0\u9ad8\u4ea7\u91cf.</br></br>\u7f57\u65af128ba\u4e0a\u7684Bartimaeusnek\u77ff\u77f3\u4e2d\u53ef\u4ee5\u5f88\u5bb9\u6613\u5730\u83b7\u5f97\u6c16. \u6c2a\u548c\u6c19\u53ef\u4ee5\u901a\u8fc7\u79bb\u5fc3\u71c3\u6599\u68d2\u83b7\u5f97. \u8fd9\u4e09\u79cd\u6c14\u4f53\u90fd\u53ef\u4ee5\u901a\u8fc7EV\u6db2\u6001\u7a7a\u6c14\u84b8\u998f\u83b7\u5f97. \u8bb0\u5f97\u88c5\u4e0a\u6db2\u6001\u7a7a\u6c14\u4ed3\u4ee5\u63d0\u4f9b\u8db3\u91cf\u7684\u6db2\u6001\u7a7a\u6c14. \u540c\u6837\u8f93\u51fa\u6700\u597d\u9009\u7528\u5de8\u578b\u8f93\u51fa\u4ed3,\u5426\u5219\u524d4\u79cd\u6c14\u4f53\u4ea7\u7269\u5c06\u4f1a\u635f\u5931\u90e8\u5206.</br></br>\u800c\u60f3\u8981\u83b7\u5f97\u9feb,\u4f60\u9700\u8981MK3\u805a\u53d8\u53cd\u5e94\u5806.</br></br>\u8fd9\u56db\u79cd\u6d41\u4f53\u5747\u53ef\u590d\u5236,\u8fd9\u4e5f\u662f\u6700\u7ec8\u7684\u91cf\u4ea7\u9009\u62e9.</br></br>[note]\u60f3\u8981\u5728\u6f06\u9ed1\u4e16\u754c\u83b7\u5f97\u77ff\u77f3,\u865a\u7a7a\u91c7\u77ff\u573a\u662f\u5fc5\u4e0d\u53ef\u5c11\u7684.[/note]",
