                    "data": "\u5904\u7406\u66f4\u5148\u8fdb\u7684\u6750\u6599(\u5b87\u5b99\u4e2d\u5b50\u6001\u7d20\u3001\u4e09\u949b\u548c\u89c9\u9192\u9f99\u952d),\u4f60\u9700\u8981\u8d85\u8fc79000K\u7684\u7089\u6e29.\u5c06\u4f60\u7684\u5de5\u4e1a\u9ad8\u7089\u57fa\u7840\u7089\u6e29\u63d0\u9ad8\u52309901K.",
