                    "x": 360.0,
                    "y": 312.0,
                    "data": "\u8fd9\u53f0\u673a\u5668\u5c31\u50cf\u666e\u901a\u6cb9\u6c14\u6d41\u4f53\u94bb\u673a\u4e00\u6837\u5de5\u4f5c\uff0c\u4f46\u53d7\u76ca\u4e8e\u00a75\u00a7l\u00a7o\u79d1\u6280\u8fdb\u6b65\u00a7r\uff0c\u5b83\u5728\u4ea7\u51fa\u65f6\u4e0d\u4f1a\u5bfc\u81f4\u5730\u4e0b\u6cb9\u7530\u50a8\u91cf\u964d\u4f4e\u3002\u65e0\u9650\u7684\u7a33\u5b9a\u7684\u8f93\u51fa\uff01",
