                    "x": 600.0,
                    "y": 432.0,
                    "data": "\u7814\u78e8\u5904\u7406\u7ebf,\u4e3aLuV\u53ca\u4ee5\u4e0a\u9636\u6bb5\u7684\u73a9\u5bb6\u8bbe\u8ba1,\u662f\u53e6\u4e00\u79cd\u53ef\u9009\u7684\u4ea7\u94df\u65b9\u5f0f.\u5b83\u4e0d\u4f1a\u65e0\u7406\u7531\u5730\u9500\u6bc1\u94dd\u548c\u65b9\u94c5,\u5e76\u4e14\u4f7f\u4f60\u53ef\u4ee5\u9ad8\u6548\u5730\u4ece\u95ea\u950c\u4e2d\u63d0\u53d6\u51fa\u94df. \u800c\u4ee3\u4ef7\u5c31\u662f\u76f8\u5173\u673a\u5668\u548c\u57fa\u7840\u8bbe\u65bd\u7684\u6295\u5165.",
