                    "data": "TNT\u6bd4\u706b\u836f\u6876\u5a01\u529b\u66f4\u5f3a\u4f46\u4e5f\u96be\u505a\u5f97\u591a.\u6709LV\u548cHV\u4e24\u79cd\u4e0d\u540c\u65b9\u6cd5\u53ef\u9009. \u5728LV\u9636\u6bb5,\u4f60\u9700\u8981\u7528\u91cd\u71c3\u6cb9\u6216\u8f7b\u71c3\u6cb9\u6765\u5236\u4f5c\u7532\u82ef.\u7532\u82ef\u53ef\u4ee5\u76f4\u63a5\u56fa\u5316\u6210\u80f6\u51dd\u7532\u82ef.\u4e5f\u53ef\u4ee5\u653e\u5165\u5316\u5b66\u53cd\u5e94\u91dc\u4e2d,\u52a0\u5165\u805a\u4e59\u70ef\u672b\u548c\u7cd6,\u4f7f\u7532\u82ef\u7684\u5229\u7528\u7387\u66f4\u9ad8.\u5c06\u80f6\u51dd\u7532\u82ef\u4e0e\u786b\u9178\u6405\u62cc\u5373\u53ef\u5236\u6210TNT. HV\u7684\u65b9\u6cd5\u9700\u8981\u77f3\u6cb9\u88c2\u5316\u673a\u7528\u4e8e\u5236\u9020\u6240\u6709\u7684\u88c2\u5316\u71c3\u6599\u6216\u88c2\u5316\u77f3\u8111\u6cb9,\u8fd8\u9700\u8981\u4e00\u53f0\u84b8\u998f\u5854\u5c06\u7532\u82ef\u63d0\u70bc\u51fa\u6765.</br>\u4e0d\u8fc7\u4f60\u8fd8\u53ef\u4ee5\u8d70\u6728\u7126\u6cb9\u8def\u7ebf,MV\u4e2d\u671f\u5373\u53ef.",
